import React from "react";
const Navigation = ({ onSignOut }) => {
  return (
    <nav style={{ display: "flex", justifyContent: "flex-end" }}>
      <div class="">
        <input
          onClick={onSignOut}
          className="f3 link dim black underline pa3 pointer"
        />
        Sign Out
      </div>
    </nav>
  );
};

export default Navigation;
